export const EventsPage = () => {
  const EVENTS = [
    { id: "1", title: "event1" },
    { id: "2", title: "event2" },
    { id: "3", title: "event3" },
  ];
  return (
    <>
      <h1>Events Page</h1>
      {EVENTS.map((event) => (
        <ul>
          <li>
            <Link to={`events/{id}`}>{event.title}</Link>
          </li>
        </ul>
      ))}
    </>
  );
};
